import React, { Fragment } from 'react';
import Card from './Card.js';

const CardList = ({ robots }) => {
    const cardsArray = robots.map((user, i) => {
        return (
        <Card 
            key={i} 
            id={user.id}  
            name={user.name} 
            email={user.email}
        />
        );
    });
    return (
    <Fragment>
        {cardsArray}
    </Fragment>
    );
}

export default CardList;
